INSERT INTO up_music_music(ID, TITLE, DESCRIPTION, IMAGE_ID, MUSIC_ID, CREATE_DATE, USER_ID, GENRE_ID) VALUES (36, 'Lili was here', 'Вспомни. Можешь сказать, знаешь ли ты. Когда она лжёт. Помнишь ли ты, когда Лили была здесь той ночью. Каждый поцелуй, прикосновение, каждый день. Она была там, но ты её отверг. Оглянись и ты найдешь её в своём сердце', 15, 16, '2023-05-10 12:29:07', 10, 1);
